import React, { useState } from "react";
import axios from "axios";

const App = () => {
  const [userData, setUserData] = useState(null);

  const URL = "http://172.20.67.54:8080/reels/applicant?hashtag=#HYPE BOY";
  const onClick = () => {
    axios
      .get(URL)
      .then((res) => {
        let Token = res.headers.get("Authorization");
        localStorage.setItem("Authorization", Token);
        return res.json();
      })
      .then((res) => {
        setUserData(res);
        console.log(res);
      })
      .catch((Error) => {
        console.log(Error);
      });
  };

  return (
    <div>
      <div>
        <button onClick={onClick}>불러오기</button>
      </div>
      {userData && (
        <textarea
          rows={7}
          value={JSON.stringify(userData, null, 2)}
          readOnly={true}
        />
      )}
    </div>
  );
};

export default App;
